import React from "react";

function Table(props) {
  const { data } = props;
  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Father Name</th>
            <th>Email</th>
            <th>Address</th>
            <th>Mobile</th>
            <th>Height</th>
            <th>Weight</th>
            <th>Nationality</th>
          </tr>
        </thead>
        <tbody>
          {data.map(function (object, i) {
            const {
              name,
              fatherName,
              email,
              address,
              mobile,
              height,
              weight,
              nationality,
            } = data[i];
            return (
              <tr key={i}>
                <td>{name}</td>
                <td>{fatherName}</td>
                <td>{email}</td>
                <td>{address}</td>
                <td>{mobile}</td>
                <td>{height}</td>
                <td>{weight}</td>
                <td>{nationality}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
      ;
    </div>
  );
}

export default Table;
